"use strict";(globalThis.webpackChunknumerology=globalThis.webpackChunknumerology||[]).push([[849],{6164(e){e.exports=JSON.parse('{"version":{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"tutorialSidebar":[{"type":"category","label":"Basics","collapsible":true,"collapsed":true,"items":[{"type":"link","href":"/docs/Basics/Birthday number","label":"Birthday number","docId":"Basics/Birthday number","unlisted":false},{"type":"link","href":"/docs/Basics/Chart","label":"Chart","docId":"Basics/Chart","unlisted":false},{"type":"link","href":"/docs/Basics/Core","label":"Core","docId":"Basics/Core","unlisted":false},{"type":"link","href":"/docs/Basics/Expression","label":"Expression","docId":"Basics/Expression","unlisted":false},{"type":"link","href":"/docs/Basics/Life Path","label":"Life Path","docId":"Basics/Life Path","unlisted":false},{"type":"link","href":"/docs/Basics/Master Numbers","label":"Master Numbers","docId":"Basics/Master Numbers","unlisted":false},{"type":"link","href":"/docs/Basics/Personality","label":"Personality","docId":"Basics/Personality","unlisted":false},{"type":"link","href":"/docs/Basics/Soul Urge","label":"Soul Urge","docId":"Basics/Soul Urge","unlisted":false}],"href":"/docs/category/basics"},{"type":"category","label":"Numerology systems","collapsible":true,"collapsed":true,"items":[{"type":"link","href":"/docs/Systems/Chaldean numerology","label":"Chaldean numerology","docId":"Systems/Chaldean numerology","unlisted":false},{"type":"link","href":"/docs/Systems/Pythagorean numerology","label":"Pythagorean numerology","docId":"Systems/Pythagorean numerology","unlisted":false},{"type":"link","href":"/docs/Systems/Vedic numerology","label":"Vedic numerology","docId":"Systems/Vedic numerology","unlisted":false}],"href":"/docs/category/numerology-systems"},{"type":"category","label":"Esoteric","collapsible":true,"collapsed":true,"items":[{"type":"link","href":"/docs/Esoteric/Vibration","label":"Vibration","docId":"Esoteric/Vibration","unlisted":false}]}]},"docs":{"Basics/Birthday number":{"id":"Basics/Birthday number","title":"Birthday number","description":"In numerology, the Birthday number (also called Birth Day number) is simply the day of the month you were born, treated as its own special energy.1[4]","sidebar":"tutorialSidebar"},"Basics/Chart":{"id":"Basics/Chart","title":"Chart","description":"In numerology, a chart (often called a numerology birth chart or numerology chart) is a structured layout of key numbers derived from your birth date and full birth name.  It serves as a \u201cmap\u201d of your personality, life path, strengths, challenges, and potential destiny, much like an astrological birth chart does for planets and signs.2[5]","sidebar":"tutorialSidebar"},"Basics/Core":{"id":"Basics/Core","title":"Core","description":"The \u201ccore\u201d refers to the five main numbers that form the foundation of your chart and are considered the most important influences in your life.1[7]","sidebar":"tutorialSidebar"},"Basics/Expression":{"id":"Basics/Expression","title":"Expression","description":"Expression number (also called the Destiny number or Personality number) is a Core number derived from the letters in your full birth name.3[6]","sidebar":"tutorialSidebar"},"Basics/Life Path":{"id":"Basics/Life Path","title":"Life Path","description":"Life Path number is considered the most important Core number in your Chart; it represents your life\u2019s purpose, main lessons, and the general \u201cpath\u201d you\u2019re meant to walk.  It\u2019s derived from your full date of birth and reduces to a single digit from 1\u20139, or to one of the Master Numbers: 11, 22, or 33. 37","sidebar":"tutorialSidebar"},"Basics/Master Numbers":{"id":"Basics/Master Numbers","title":"Master Numbers","description":"Master Numbers are special double\u2011digit numbers that are not reduced to a single digit (1\u20139) because they\u2019re believed to carry a higher, more intense Vibration. The three main Master Numbers are 11, 22, and 33, and they often appear in core positions like Life Path, Expression, or Soul Urge] numbers.14[6]","sidebar":"tutorialSidebar"},"Basics/Personality":{"id":"Basics/Personality","title":"Personality","description":"Personality usually refers to the Personality Number (also called the \u201couter personality\u201d or \u201cfirst impression\u201d number), which shows how you naturally come across to others and how people tend to see you before they really know you.  It is one of the core numbers in a numerology chart, alongside Life Path, Expression, and Soul Urge.15","sidebar":"tutorialSidebar"},"Basics/Soul Urge":{"id":"Basics/Soul Urge","title":"Soul Urge","description":"Soul Urge (also called Heart\u2019s Desire or Soul Number) reveals what you truly long for on the inside: your deepest desires, motivations, and emotional needs.  It shows what feels most meaningful to you, even if it doesn\u2019t match how you appear on the outside.15","sidebar":"tutorialSidebar"},"Esoteric/Vibration":{"id":"Esoteric/Vibration","title":"Vibration","description":"In numerology, vibrations refer to the idea that each number carries a distinct energetic quality or frequency that influences people, names, dates, and events.  Practitioners treat numbers not just as abstract symbols but as living patterns of energy\u2014like musical notes\u2014that shape personality traits, life experiences, and spiritual lessons.15[8]","sidebar":"tutorialSidebar"},"Systems/Chaldean numerology":{"id":"Systems/Chaldean numerology","title":"Chaldean numerology","description":"Chaldean numerology is an ancient system of numerology that originated in Mesopotamia (modern\u2011day Iraq) and is often described as one of the oldest known forms of name\u2011based numerology.  It focuses on the vibrational energy of letters in a name and how those vibrations influence a person\u2019s character, destiny, and life events.137","sidebar":"tutorialSidebar"},"Systems/Pythagorean numerology":{"id":"Systems/Pythagorean numerology","title":"Pythagorean numerology","description":"Pythagorean numerology is a Western system of numerology based on the ideas of the ancient Greek philosopher and mathematician Pythagoras, who taught that numbers are the fundamental building blocks of reality and carry spiritual or \u201cvibrational\u201d meaning.  It is also commonly called modern or Western numerology and is one of the most widely used numerology systems today.14[7]","sidebar":"tutorialSidebar"},"Systems/Vedic numerology":{"id":"Systems/Vedic numerology","title":"Vedic numerology","description":"Vedic numerology (also called Indian or Hindu numerology) is a traditional system from the Vedic\u2011astrology tradition of India that interprets numbers derived from your birth date and name as carriers of planetary energy and karmic patterns.  It treats numbers as vibrations linked to the nine planets (Navagrahas), so each digit from 1 to 9 is associated with a specific planet and set of qualities.13[6]","sidebar":"tutorialSidebar"}}}}')}}]);